var $fairyApp=angular.module("fairyApp",["ngRoute","firebase"]);$fairyApp.config(function(e){e.when("/vouchers",{controller:"vouchersController",templateUrl:"/ng/templates/vouchers.html"}).otherwise({redirectTo:"/vouchers"})});$fairyApp.controller("vouchersController",["$scope","$firebase",function(e,t){var n=new Firebase("https://scorching-fire-7581.firebaseIO.com/vouchers/");e.vouchers=t(n);var r=new Firebase("https://scorching-fire-7581.firebaseIO.com/partners/");e.partners=t(r)}]);$fairyApp.controller("testController",["$scope","$firebase",function(e,t){var n=new Firebase("https://scorching-fire-7581.firebaseIO.com/");e.comments=t(n);e.username="Guest"+Math.floor(Math.random()*101);e.addComment=function(t){if(t.keyCode!=13)return;e.comments.$add({from:e.username,body:e.newComment});e.newComment="";t.preventDefault()}}]);